Mais quand je lance le launcher, le mot de passe se sauvegarde pas, j'ai bien mit le fichier dans l'ignore list, quelqu'un peut m'aider ?
VoilÃ  ce que j'ai mit dans ma class PasswordSaver
```JAVA
package fr.EllioMario.MarioKraft8DeluxeLauncher;

import fr.theshark34.openlauncherlib.launcher.GameInfos;
import java.io.*;

public class PasswordSaver {

    public PasswordSaver(GameInfos gameInfos) {
        passwordFile = new File(gameInfos.getGameDir(), "password.txt");
    }

    public PasswordSaver(File passwordFile) {
        this.passwordFile = passwordFile;
    }

    public String getPassword(String def) {
        try {
            BufferedReader br = new BufferedReader(new FileReader(passwordFile));
            String password = br.readLine();
            br.close();
            return password;
        }
        catch(IOException e) {
            return def;
        }
    }

    public void setPassword(String password) {
        try {
            FileWriter fw = new FileWriter(passwordFile);
            fw.write(password);
            fw.close();
        }
        catch(IOException e) { }
    }

    private File passwordFile;
}
```

