private int countTeam = this.teams.size();

    public void startWave() {
        int currentWave = wave;
        countTeam = this.teams.size();
        while (countTeam > 1) {
            createRandomDuel();
        }
    }

    public void createRandomDuel() {
        Team team = getRandomTeam();
        Team opponant = getRandomTeam();
        if (team == null || opponant == null)
            return;
        duels.add(new Duel(team, opponant));
        countTeam -= 2;

    }

    public int getDuelTeam() {
        return (int) this.teams.stream().filter(team -> team.isInDuel()).count();
    }

    public Team getRandomTeam() {
        if (getDuelTeam() - teams.size() <= 1)
            return null;
        Team team = this.teams.get(random.nextInt(this.teams.size()));
        if (team.isInDuel())
            return getRandomTeam();
        else {
            team.setInDuel(true);
            return team;
        }
    }
